  //  address[] addrSet;

    mapping(address =>FormStruct) addressToStruct;
    mapping(string =>FormStruct)  hashToStruct;

   

    event StorageF(uint t0); 
    



//
function addForm(address _ad,uint[6] memory _sym,string memory _stime, string memory _pcode)public {
  FormStruct memory fs;
  fs= FormStruct(_ad,_sym,_stime,_pcode,true);
  uint t0= fs.symSet[0];

  addressToStruct[_ad]=fs;

  //emit StorageF(t0);
  
}
// 
function findSym(address _ad) public view returns(uint){
    uint[6] memory tset=addressToStruct[_ad].symSet;
    uint t0 = tset[0];

    return t0;
}


//
/******************************** 
    function storeHash(address _addr,string memory _fileHash,string memory _fileName,string memory _fileTime) public {

        FormStruct memory ps;

        bool returnFlag =true;

        //hash
        if(map.insertedHash[_fileHash]!=true){ //hash

           //   ps= FormStruct(_addr,_fileName,_fileHash,_fileTime,map.size(),true);
              map.set(_addr, _fileHash);                        
              hashToStruct[_fileHash]=ps;
        }else{       //Hash,
          returnFlag = false;
        }
     
        uint msize =  map.size();
        emit StorageE(_addr,returnFlag,msize);

    }

    ***************/

